import { useEffect, useState } from 'react'
import io from 'socket.io-client'
import TreeChannel from './components/TreeChannel/TreeChannel'

import classes from './Admin.module.css'
import ModalWindows from '../../UI/ModalMindow/ModalWindow'

const socket = io('http://10.147.18.205:3001')


interface IResults {
	categorys: Map<string, Array<IItems>>,
	otherChats: Array<IItems>
}

interface IItems{
	name: string,
	id: number,
	type: string
}

const Admin = () => {
	const [AllChats, setAllChats] = useState(null)

	useEffect(() => {
		const fetchData = async () => {
			try {
				socket.emit('GetAllChannelFromServer', (results:IResult) => {
					if (results !== null)
						results.categorys = new Map(JSON.parse(results.categorys))
					setAllChats(results)
				})
			} catch (error) {
				console.log('Error fetching data:', error)
			}
		}

		fetchData()
		return () => {
			socket.off('updatePlaylist')
		}
	}, [])

	return (
		<div className={classes.container}>
			<TreeChannel nodeChats={AllChats} />
			<ModalWindows/>
		</div>
	)
}

export default Admin
